import React from "react";
import NavBar from './NavBar';
import Home from './Home';
import About from './About';
import LogIn from './user/LogIn';
import SingUp from './user/SingUp';
import {UsersProvider, BrowserRouter, Route, Routes } from 'react-router-dom'
import AddRecipeMeneger from "./manager/AddRecipeMeneger";
import CategoryRecipe from "./CategoryRecipe";

export default function RoutesComponent(){

    return(
        <BrowserRouter>
          <NavBar/>
            <Routes>
              <Route path='/' element={<AddRecipeMeneger />} />
              <Route path='/login' element={<LogIn />} />
              <Route path='/home' element={<Home />} />
              <Route path='/singup' element={<SingUp />} />
              <Route path='/about' element={<About />} />
              <Route path='/category-recipe/:categoryId' element={<CategoryRecipe />} />


            </Routes>
          </BrowserRouter>
    )
}
